import cirkles from "../../images/cirkles.png";
import './AboutUsHedader.css';
export default function AboutUsHedader(){

    return(
        <div className='hedader_top'>
            <div className='hedader_top_cirkles'>
                <img src={cirkles} alt=""/>
            </div>
            <div className='hedader_top_info_titles'>
                <h1 className='hedader_top_info_title'>about us</h1>
            </div>
        </div>
    )

}
